INSERT INTO `advice_config` VALUES ('1', '<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n	您好！欢迎您进入“院长书记信箱”，为医院的发展提出合理化建议，并对我们工作中的不足之处进行批评和指正。本着公平、公正的原则，我们将依据有关政策和学院规章制度认真办理您的来信。如您实名来信，我们将严格按照信访有关规定，为您的来信提供保密措施。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp; 您的来信我们会尽快作出答复。同时，对可以公开答复的问题，我们将在本栏目中公示。如您需要得到有关方面的书面（纸质）答复，请您详细填写联系电话和联系地址！ <span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp; 从来信送达本部门之日起，紧急来信应立即研究办理，重要来信原则上在5个工作日内办理完毕，一般来信原则上在10个工作日内办理完毕，反映问题比较复杂的来信原则上在30个工作日内办理或答复完毕。 详见《书记、院长信箱管理办法》。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp; 谢谢您对医院工作的支持！祝您工作、生活愉快！\r\n</p>', '<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n	一、院长书记信箱是医院领导密切联系职工，听取职工和群众有关意见与建议的重要渠道。为进一步做好党务、院务、信息公开工作，充分发挥院长书记信箱的作用，保证民主渠道的畅通和规范管理，特制定本办法。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n	二、医院在OA系统中设置“院长书记信箱”栏目，信箱由医院办公室具体负责管理，并指定专人对来信进行登记、分类整理、流转、答复和归档。信箱一般每天查看一次。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　三、处理来信\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　1、信箱管理员对来信进行登记，送交医院办公室主任阅处，按照“谁主管、谁负责”的原则，提出拟办意见。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　2、信箱管理员根据拟办意见，对来信进行分类处理。原则上紧急或重要来信送交医院主要领导或分管院领导阅示后，根据院领导批示意见落实办理或转送相关科室办理；一般来信直接送交相关科室办理。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　3、各科室对来信应按照“件件有着落，事事有交待”的原则，认真及时办理。从来信送达本部门之日起，紧急来信应立即研究办理，重要来信原则上在5个工作日内办理完毕，一般来信原则上在10个工作日内办理完毕，反映问题比较复杂的来信原则上在30个工作日内办理或答复完毕。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　4、各科室须将办理情况以书面答复形式由科室负责人签署意见（或签章）后报送信箱管理员备案，同时电子版发送信箱管理员，以便信箱管理员及时答复和反馈。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　5、凡涉及多个科室工作的来信办理，由主办科室负责牵头协调落实。对于无故不予办理或推诿扯皮，给医院造成不良影响的，将追究相关责任人的责任。 <span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　6、信箱管理员要负责对来信办理情况的催办，并做好登记备案工作。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　7、办公室要加强对院长书记信箱相关文字材料的管理，及时整理归档。注意保密，不得丢失来信和有关材料；不得将检举揭发投诉和属于个人隐私等来信内容外传；未经批准，不得随意扩大来信和有关材料的知情范围。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	　　四、本办法由医院办公室负责解释。\r\n</p>\r\n　　五、本办法自公布之日起实施。');
