INSERT INTO `care` VALUES ('7', '潜山路学校:“阅读月”总结表彰暨汇报表演活动成功举行', '100', '121', '21', '<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;\">\r\n	3月10日下午，省教育厅召开了全省教育系统党风廉政建设工作暨治理教育乱收费厅局际联席会视频会议。瑶海区教体局组织局属各单位党政负责人以及教体局领导班子成员收看了此次视频会议。\r\n</p>\r\n<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">&nbsp; &nbsp; 视频会议上，省教育纪工委书记王宜作工作报告。报告回顾总结了2013年我省教育系统党风廉政建设工作以及治理教育乱收费工作，安排部署2014年的工作任务。</span> \r\n</p>\r\n<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><img alt=\"\" src=\"http://www.hfyhjy.net.cn/uploads/20140311/20140311083624_73360.jpg\" /><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">&nbsp; &nbsp; 省教育厅副厅长金燕阐述了2013年安徽省规范办学行为和治理教育乱收费情况，指出了在教育系统还存在着思想观念落后、群众反应强烈的乱收费问题没有得到遏制以及各地还存在乱办班现象等问题，同时要求大家在2014年要继续提高认识，完善和落实有关政策规定，加大治理教育乱收费的力度；要增强责任感和使命感，为深化教育改革作出新的更大的贡献。</span> \r\n</p>\r\n<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">&nbsp; &nbsp; 省委教育工委书记、省教育厅厅长程艺到会并作了重要讲话。程艺要求，各级党委要认真履行落实主体责任，当好廉洁自律的表率；要认真深化作风建设，严明党的纪律，保持惩治和预防腐败的高压态势。程艺强调，加强党风廉政建设和治理教育乱收费责任重大，希望各级党委迅速传达此次会议精神，要结合单位特点和实际，将活动细化到各部门，省教育厅将对各地落实情况进行测评。</span> \r\n</p>\r\n<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><img alt=\"\" src=\"http://www.hfyhjy.net.cn/uploads/20140311/20140311083644_70104.jpg\" /><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">&nbsp; &nbsp; 视频会议结束之后，瑶海区教体局党委书记陆在金对贯彻落实此次视频会议精神作出部署。陆在金要求大家时刻保持头脑清楚，深刻领会，狠抓落实；纪律要严明，要结合学校实际，完善党风廉政建设和治理教育三乱的各种举措；作风要扎实，以良好的作风促进工作落实；成效要明显，深入推进惩防体系建设，切实履行“一岗双责”责任制。(宣教室)</span> \r\n</p>', '2', '2014-08-28 13:59:00', '14');
