INSERT INTO `care` VALUES ('10', '望江路学校:“阅读月”总结表彰暨汇报表演活动成功举行', '120', '', 'david', '<p>\r\n	<span style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;line-height:21px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;省教育厅副厅长金燕阐述了2013年安徽省规范办学行为和治理教育乱收费情况，指出了在教育系统还存在着思想观念落后、群众反应强烈的乱收费问题没有得到遏制以及各地还存在乱办班现象等问题，同时要求大家在2014年要继续提高认识，完善和落实有关政策规定，加大治理教育乱收费的力度；要增强责任感和使命感，为深化教育改革作出新的更大的贡献。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;line-height:21px;background-color:#FFFFFF;\"><span style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;line-height:21px;background-color:#FFFFFF;\">&nbsp; &nbsp;&nbsp;</span><span style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;line-height:21px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"color:#666666;font-family:Tahoma, verdana, Arial;font-size:14px;line-height:21px;background-color:#FFFFFF;\">省教育厅副厅长金燕阐述了2013年安徽省规范办学行为和治理教育乱收费情况，指出了在教育系统还存在着思想观念落后、群众反应强烈的乱收费问题没有得到遏制以及各地还存在乱办班现象等问题，同时要求大家在2014年要继续提高认识，完善和落实有关政策规定，加大治理教育乱收费的力度；要增强责任感和使命感，为深化教育改革作出新的更大的贡献。</span><br />\r\n</span> \r\n</p>', '2', '2014-09-02 16:06:08', '16');
